Standing before you are five treasure rooms holding the most unimaginable riches. Enter and complete their daunting challenges with help from ancient artifacts and magical totems. Beware of dangers that lie within however because one wrong move, and you may be sealed there for eternity.

Play 160 amazing levels and 42 extra Puzzle levels while attempting to retrieve the fabulous treasures. Match colorful tokens to obtain the necessary amounts required to unlock the chests and with each successful attempt, you'll earn stars to acquire helpful power-ups. Watch magical totems come to life, invent unique strategies for using them effectively, and see your wealth escalate. With two play modes, 22 obtainable trophies, beautiful graphics and sound, and a jungle of challenges before you, making it back to civilization may take longer than you think.
